import React from 'react';

function Packages() {
  return (
    <div className="packages-container">
      <h1>Gardening Packages</h1>
      {/* Add package details here */}
      <p>Explore our various gardening packages tailored to your needs!</p>
    </div>
  );
}

export default Packages;
